import React from 'react'
import Menu from './Menu'
import Notes from './notes/Notes'

const Navbar = ({ notes, profile }) => {
    return (
        <div className="navbar d-flex justify-content-between">
            <Profile profile={profile} />
            <Notes notes={notes} />
        </div>
    )
}

export default Navbar
